INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 17814065, "ええっと、確認なんですけど。\nもしかして、もしかしなくても、\n私の誕生日ケーキってことで\nあってますか？", 11, 103711, 0.5, 17814);
