INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 18814076, "どう見たって誕生日ケーキだろう？\n心配しなくても、ナナカのお祝いだ。\n誕生日、おめでとう。", 11, 105611, 0.5, 18814);
