INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 18814081, "ケーキとは別に、プレゼントも\nいくつか用意してあるのよ。\n私たちじゃどんなのがいいか\nよく分からなかったから……", 11, 105111, 0.5, 18814);
