INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 31114076, "それならプリンがいいの～！\nこのケーキと同じくらい、でっかい\nプリンが食べたいの～！", 11, 100711, 0.5, 31114);
INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES ("", "", "", "", "", 31114077, "", 91, 0, "", 31114);
