INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 31114091, "これ、お主たち。\nシノブの誕生日じゃというのに、\nお返しの話題で盛り上がるでないわ。\nまったく、こやつらは……", 11, 104411, 0.5, 31114);
