INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 31114096, "大丈夫ですよ、イリヤさん。\nいつも通りの、自由な雰囲気で\n祝ってもらう方が気も楽ですから。\nあなたも、きっとそうですよね？", 11, 103111, 0.5, 31114);
