INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 34314081, "オマエたち、よくわかってるプレゼント\n本当にありがとうなの～♪\n次から誕生日だけじゃなくて、\nお盆と命日にもプリンを寄こすの～", 11, 100711, 0.5, 34314);
INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES ("", "", "", "", "", 34314082, "", 91, 0, "", 34314);
