INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 35814065, "……気持ちは大変にありがたいが。\nワタシの誕生日を祝って大丈夫なのか？\n表向きには、相当問題のある流れで\nギルドから出奔した女だぞ。", 11, 107111, 0.5, 35814);
