INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (10, 1, 0, 1, 0, 38214070, "マヒルさん、どうしました……？\nもしかして、誕生日ケーキに\n変なところでも……？", 11, 103811, 0.5, 38214);
